#include <stdio.h>
#include <stdlib.h>
void rotateInner(int *nums,int left,int right){
	int tmp;
	while(left<right){
		tmp = nums[left];
		nums[left++] = nums[right];
		nums[right--] = tmp;
	}
}
void rotate(int* nums, int numsSize, int k) {
	int mod = k%numsSize;
    rotateInner(nums,0,numsSize-mod-1);
    rotateInner(nums, numsSize-mod, numsSize-1);
    rotateInner(nums, 0, numsSize-1);
}

